angular.module("extension-registry").run(["$templateCache", function($templateCache) {$templateCache.put("__extension-html.html","<div\n  ng-bind-html=\"item.html\"\n  class=\"extension-sanitize extension-html extension-{{index}} {{item.className}}\"></div>\n");
$templateCache.put("__extension-link.html","<a ng-if=\"!item.onClick\"\n   ng-href=\"{{item.href}}\"\n   target=\"{{item.target}}\"\n   title=\"{{item.linkText}}\"\n   class=\"extension-link extension-{{index}} {{item.className}}\">\n   {{item.linkText}}\n </a>\n\n<a ng-if=\"item.onClick\"\n   ng-href=\"#\"\n   ng-click=\"item.onClick(args)\"\n   title=\"{{item.linkText}}\"\n   class=\"extension-link extension-{{index}} {{item.className}}\">\n   {{item.linkText}}\n </a>\n");
$templateCache.put("__extension-point.html","<div class=\"extension-point extension-list\">\n  <div\n    ng-repeat=\"item in items track by $index\"\n    class=\"extension-repeater\">\n    <!-- todo: how to pass each item to the renderer -->\n    <extension-renderer\n      class=\"extension-renderer extension-item\"\n      item=\"item\"\n      index=\"$index\"\n      args=\"args\"></extension-renderer>\n  </div>\n</div>\n");
$templateCache.put("__extension-renderer.html","<div\n  ng-switch on=\"item.type\">\n  <div ng-switch-when=\"text\">\n    <div ng-include=\" \'__extension-text.html\' \"></div>\n  </div>\n  <div ng-switch-when=\"link\">\n    <div ng-include=\" \'__extension-link.html\' \"></div>\n  </div>\n  <div ng-switch-when=\"select\">\n    <div ng-include=\" \'__extension-select.html\' \"></div>\n  </div>\n  <div ng-switch-when=\"html\">\n    <div ng-include=\" \'__extension-html.html\' \"></div>\n  </div>\n</div>\n");
$templateCache.put("__extension-select.html","<select\n  name=\"item.nameText\"\n  ng-model=\"selected\"\n  ng-init=\"selected = item.options[0]\"\n  ng-change=\"item.onChange(selected)\"\n  class=\"extension-select extension-{{index}} {{item.className}}\"\n  ng-options=\"option.value for option in item.options\"></select>\n");
$templateCache.put("__extension-text.html","<div\n  class=\"extension-text extension-{{index}} {{item.className}}\">\n  <p>{{item.text}}</p>\n</div>\n");}]);